INSERT INTO `event` VALUES (1,'LANY a november to remember','LANY','後疫情時代迫不及待要用LIVE舞台和全球歌迷見面的加州新生代樂團LANY，兩位高顏質成員Paul Klein和Jake Goss繼2017年首度在台開唱之後，將二度以浪漫搖滾風潮席捲台灣。累積超過35億線上串流點聽次數、7.5億的影片點閱次數和全球逾50萬的演唱會動員人數。LANY為亞洲歌迷專屬打造最難忘的11月全新巡演，疫情期間發行的兩張新專輯【Mama’s Boy】、【gg bb xx】收錄歌曲一次完美呈現，從第一站台灣起跑，帶給歌迷亞洲限定的全新音樂感受和現場體驗！','1657956850051.png',''),(2,'Alec Benjamin: The (Un)Commentary Tour','Alec Benjamin','療癒系創作新星 Alec Benjamin即將帶著新專輯巡迴首度登台！\n\n擁有「音樂說書人」封號的Alec，擅長以音樂描寫自己眼中的世界，將你我生活中看似尋常的點滴編織成篇篇動人的音樂故事。從小就立志成為歌手的Alec，其實在圓夢的路上並不順遂，甚至曾遭前公司單方解約而失去所有音樂版權，但他不畏艱難勇敢追夢，帶著一把吉他走上街頭獻唱，憑著自己不放棄的毅力及獨具風格的清新嗓音，累積了一批死忠粉絲，並以破億心碎神曲<Let Me Down Slowly>爆紅而成功獲得全球樂壇矚目。苦練中文多年的他，也曾將自己多首歌曲翻唱成中文版本，屆時台灣場次會端出什麼樣的台灣場限定驚喜歌單，相信可以好好期待！','1657956850051.png',NULL),(3,'NIGEL NG THE HAIYAA WORLD TOUR','Nigel Ng','以「羅傑叔叔」角色在影片中吐槽BBC蛋炒飯教學影片而一夕爆紅、在YouTube上擁有超過400萬訂閱者的馬來西亞裔Nigel Ng (黃瑾瑜)即將要以本職來台演出單口喜劇囉! 誇張且刻意強調亞洲刻板印象的搞笑風格，加上「Haiyaa」這個口頭禪，讓Nigel迅速在網路上受到關注。因為在倫敦生活的亞裔背景，讓他的演出充滿許多獨特的幽默觀點，不只吐槽別人時諷刺尖銳，黑自己更是沒在客氣，在脫口秀界走出一片天，可說幾乎是站上亞裔單口喜劇的巔峰。2022年後疫情時代首度登台，帶你拋開所有沉重與不愉快，Nigel Ng等你現場來開笑！','1657956850051.png',NULL);
/*!40000 ALTER TABLE `event` ENABLE KEYS */;
UNLOCK TABLES;

